import { FC, ReactNode } from "react";
interface Squareprops {
  value: string;
  children: ReactNode;
  onClick: () => void;
}
const Square: FC<Squareprops> = (props, children) => {
  return (
    <button className="square" onClick={props.onClick}>
      {props.value}
      {props.children}
    </button>
  );
};

export default Square;
